import './index.scss'

const alinks = document.querySelectorAll('a')

alinks.forEach(link => {
	link.addEventListener('mouseover', function(event) {
		event.target.transition = 'all .2s ease-in-out'
		event.target.transform = 'scale(1.8)'
	})
})

console.log(alinks)
